export const toggleTodoAction =(store,todo) => {
    return(store.dispatch({
        type: "TOGGLE_TODO",
        id: todo.id
    })
)
}
export const deleteTodoAction =(store,todo) => {
    return(store.dispatch({
            type: "DELETE_TODO",
            id: todo.id
        })
    )
}
